import pdb
import json
from wordpress_xmlrpc import Client, WordPressPost
from wordpress_xmlrpc.methods.posts import GetPosts, NewPost, EditPost, GetPost
from wordpress_xmlrpc.methods.users import GetUserInfo
from wordpress_xmlrpc import WordPressPost

configuration = json.loads(open('config.json').read())

wp = Client('https://greateraustinsecularhub.org/xmlrpc2.php', configuration['MeetupUser'], configuration['MeetupKey'])

posts = wp.call(GetPosts({'post_type': 'events'}))
post = wp.call(GetPost(73))
#print(post.custom_fields)
#pdb.set_trace()
post = WordPressPost()
#pdb.set_trace()
post.title = 'Sunday Gathering: A Humanist Community of Compassion and Reason'
post.post_type = 'events'
post.content = """
<b>Time:</b>  12:00 - 14:00
<br>
<b>Location:</b>  Spider House Ballroom
<br>
<b>Organizer:</b> Austin Humanist Community
<br>
<b>Tags:</b> For kids, Volunteering
<br>
<b>Link to event:</b>
<a href="http://www.google.com" target="_blank">http://www.meetup.com/asdfasdfasdf/asdf/asdfasdfsadf</a>
<br><br>
<b>Description (First part of event summary):</b>
<br>
~ Weekly attendance is approximately 35 people ~
<br><br>
This week's meeting topic:<br>
Stuff. We are buried in stuff and under constant pressure to buy more. It's time to talk about all this stuff. Where it comes from. What it really costs. What you can do to have your stuff and be ethical. Using the framework of Sustainable Development Goal 12 (Responsible Consumption and Production), let's consider the ethics of stuff--especially the stuff we have in our closets--from beginning to end.
<br><br>
...
"""

#    'calendar': ['Austin Humanist Community'],
post.excerpt = post.content
post.terms_names = {
    'post_tag': ['Gathering'],

    'venue': ['Spider House'],
    'organizer': ['Austin Humanist Community']
}

